Zoals elk geneesmiddel kan ook dit geneesmiddelbijwerkingen hebben, al krijgt niet iedereen daar mee te maken. Vaak voorkomende bijwerkingen (bij maximaal 1 op de 10 personen): 
- Diarree; 
- Misselijkheid/braken; 
- Vermoeidheid; 
- Duizeligheid; 
- Hoofdpijn; 
- Jeuk (pruritis); 
- Rug-, spier-of gewrichtspijn; 
- Pijnlijke keel. Soms voorkomende bijwerkingen (bij maximaal 1 op de 100 personen): 
- Infecties van het gebit; 
- Vaginale schimmelinfecties; 
- Depressie; 
- Verstopte neus; 
- Bloeding, bloeduitstortingen, verharding, zwelling, jeuk, roodheid en pijn op de plaats waar de injectie gegeven is; 
- Zich zwak voelen; 
- Hangend ooglid en uitgezakte spieren aan een kant van het gelaat (aangezichtsverlamming), gewoonlijk tijdelijk van aard; 
- Verandering in psoriasis met roodheid en nieuwe kleine, gele of witte huidblaren, die soms gepaard gaan met koorts (pustulaire psoriasis); 
- Afschilfering van de huid; (huidexfoliatie); 
- Acne. Zelden voorkomende bijwerkingen (bij maximaal 1 op de 1000 personen): 
- Ernstige allergische reacties (anafylaxie waarvan de verschijnselen onder andere zijn: o Moeite met ademen of slikken o Lage bloeddruk die duizeligheid of een licht gevoel in het hoofd kan veroorzaken o Gezwollen gelaat, lippen, mond of keel 
- Roodheid en vervelling van de huid over een groter gebied van het lichaam, waarbij de huid kan jeuken en pijnlijk kan zijn (exfoliatieve dermatitis); 
- Roodheid van de huid over een groot gebied vaak samengaand met koorts (erythrodermische psoriasis). Neem contact op met uw behandelend medisch specialist indien n of meerdere van bovenstaande verschijnselen of andere lichamelijke klachten optreden.

