section_text:
Eenmaal thuis moet u het de eerste week rustig aan doen. Tevens mag u de eerste week na de behandeling niet fietsen/ sporten. In de eerste dagen na de ablatie behandeling komen er afvalstoffen vrij waardoor uw lichaamstemperatuur iets verhoogd kan zijn. Deze afvalstoffen plast u vanzelf uit. Neem contact op met de polikliniek urologie bij: 
- Onwel worden; 
- Heftige pijn; 
- Bloed bij de urine; 
- Koorts boven de 38,5C.

